import ReactDOM from 'react-dom'


const Header = (props) => {
  return (
    <h1>{props.course}</h1>
  )
}

const Content = (props) => {
  return (
    <div>
        <SubContent part={props.part1} exercises={props.exercises1} />
        <SubContent part={props.part2} exercises={exercises1} />
        <SubContent part={props.part3} exercises={exercises1} />
    </div>
  )
}

const SubContent = (props) => {

  return (
    <p>
      {props.part} {props.exercises}
    </p> 
  )
}

const Total = () => {
